import React from 'react';
import Grid from '@material-ui/core/Grid';

function LoginPage() {
  return (
    <div>
        <Grid container>
            <Grid item xs={3}>aaa</Grid>
            <Grid item xs={6}>
                <div>
                    <div></div>
                    <div></div>
                </div>
            </Grid>
            <Grid item xs={3}>ccc</Grid>
        </Grid>
        Hello World!
    </div>
  );
};

export default LoginPage;
